import { useEffect } from 'react';
import AuthUser from './AuthUser';

export default function Dashboard() {
    const { fetchUsers, users } = AuthUser();
    const { fetchPosts, wpisy } = AuthUser();

    useEffect(() => {
      fetchUsers();
      fetchPosts();
    }, []);

    return (
        <table className="table">
        <thead>
          <tr>
            <th>Nazwa uzytkownika</th>
            <th>Tresc wpisu</th>
          </tr>
        </thead>
        <tbody>

        </tbody>
        </table>
    );
}
